  input: '"TEXT","F3XA","C00143743","In response to the Commissions November 26, 2003
    letter, the Committee amends it report as follows. Transfers from the non-federal
    account in March 2003 included amounts for the non-federal share of allocable
    expenditures made during previous months, but within the sixty day window permitted
    by the regulations cited the Commissions letter. Since no prohibited transfers
    occurred and no excessive transfers occurred, the declines to take any action
    of this matter. In order to comply with the Commissions best efforts process,
    the Committee takes the following steps.  In the Committees initial solicitation,
    the Committee asks each donor for no less than the following information: full
    name, mailing address, occupation and name of employer.  Upon receipt of this
    information, the Committee records it for each donor.  Next, within thirty days
    (normally fifteen days) of receipt of a contribution from a donor for which we
    do not have occupation and employer information, we send a letter to the donor
    that both thanks the donor and again requests that the donor provide us with their
    occupation and employer information.   This letter includes a statement about
    the requirements of federal law.  This letter is also accompanied by a self-addressed,
    stamped envelope.  In addition, all information received by the Committee is reported.  Following
    these procedures, the Committee believes it has met the three-part best efforts
    provisions outlined in your letter. Items on Schedule B that the Commission questions
    were for Fundraising activities, not express advocacy for a federal candidate.
    No staff members spent 25% or more of their time on activities in connection with
    a federal election during the month of March 2003, and thus the salaries were
    not required to be paid for with federal funds, salaries are reflected on Schedule
    B for Line 21(b) for each month of 2003."'
